import React from "react";
import Hero from "../components/Hero";
import { NavLink } from "react-router-dom";

const Home = () => {
  return (
    <div className="homepage">
      <Hero />
      <div className="signup-redirection">
        <NavLink to="/signup">
          <button className="signin-redirection-button">
            <span className="text-red-color">Sign Up</span> Now !
          </button>
        </NavLink>
      </div>
    </div>
  );
};

export default Home;
